import React from 'react';
import {
  Alert,
  Button,
  StyleSheet,
  View,
  PermissionsAndroid,
  Platform
} from 'react-native';
import RNFetchBlob from 'rn-fetch-blob';
import RNHTMLtoPDF from 'react-native-html-to-pdf';

function App() {
  const fRequestAndroidPermission = async () => {
    // Refer to https://reactnative.dev/docs/permissionsandroid for further details on permsissions 
    try {
      const granted = await PermissionsAndroid.request(
        PermissionsAndroid.PERMISSIONS.WRITE_EXTERNAL_STORAGE,
        {
          title: "App1 Permission Request",
          message: "App1 needs access to your storage so you can save files to your device.",
          buttonNeutral: "Ask Me Later",
          buttonNegative: "Cancel",
          buttonPositive: "OK"
        }
      );
      
      if (granted === PermissionsAndroid.RESULTS.GRANTED) {
        console.log("permission is granted");
        return true; 
      } else {
        console.log("permission denied");
        return false; 
      }
    } catch (err) {
      console.error("fRequestAndroidPermission error:", err);
      return false; 
    }
  };


  const base64Download = async () => {
    if (Platform.OS === "android") {
      const permissionGranted = await fRequestAndroidPermission(); 
      if (!permissionGranted) {
        console.log("access was refused")
        return; 
      }
    }

    const base64Data = ``;
    const bData = `${base64Data}`;
    const path = `${RNFetchBlob.fs.dirs.DownloadDir}/abc/test123.pdf`;

   try {
     const data = await RNFetchBlob.fs.writeFile(path, bData, 'base64');
     console.log(data, 'data');
     Alert.alert("Download", `Your file has been downloaded; ${path}`)
   } catch (error) {
     console.log(error.message);
   }
   // console.log(file.filePath);
 };

 const handleDownload = async () => {
  const html = '<h1>Welcome </h1>';
  let options = {
    html: html,
    fileName: 'test',
    directory: 'Download',
  };

  // let file = await RNHTMLtoPDF.convert(options)
  if (Platform.OS === "android") {
    const permissionGranted = await fRequestAndroidPermission(); 
    if (!permissionGranted) {
      console.log("access was refused")
      return; 
    }
  }

  let file = await RNHTMLtoPDF.convert(options);
  // console.log(file.filePath);
  Alert.alert("Download", `Your file has been downloaded; ${file.filePath}`)
}

  return (
  <View>
     <View>
          <Button title="Download" onPress={handleDownload} />
        </View>
        <View>
          <Button title="DownloadBase64" onPress={base64Download} />
        </View>
  </View>
  );
}

const styles = StyleSheet.create({
  sectionContainer: {
    marginTop: 32,
    paddingHorizontal: 24,
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: '600',
  },
  sectionDescription: {
    marginTop: 8,
    fontSize: 18,
    fontWeight: '400',
  },
  highlight: {
    fontWeight: '700',
  },
});

export default App;
